def load_data(area_no, month_no, no_vals):
    data = []
    with open(r"rainfall in india 1901-2015.csv", 'r',encoding = 'utf-8-sig') as file:
        csv_reader = reader(file)
        for row in csv_reader:
            if not row:
                continue
            data.append(row)
    dat = []
    start = 115 * area_no + 85
    to = start + 105
    for n in range(start, to, 1):
        dat.append([])
        for i in range(no_vals + 1):
            dat[n-start].append(float(data[n+i][month_no]))
    return dat
def dataset_minmax(dataset):
    stats = [[min(column), max(column)] for column in zip(*dataset)]
    return stats
def normalize_dataset(dataset, minmax):
    for row in dataset:
        for i in range(len(row)):
            row[i] = (row[i] - minmax[i][0]) / (minmax[i][1] - minmax[i][0])
def activate(weights, inputs):
    activation = weights[-1]
    for i in range(len(weights)-1):
        activation += weights[i] * inputs[i]
    return activation
def transfer(activation):
    return 1.0 / (1.0 + exp(-activation))
def forward_propagate(network, row):
    inputs = row
    for layer in network:
        new_inputs = []
        for neuron in layer:
            activation = activate(neuron['weights'], inputs)
            neuron['output'] = transfer(activation)
            new_inputs.append(neuron['output'])
        inputs = new_inputs
    return inputs
def predict(network, row):
    outputs = forward_propagate(network, row)
    return max(outputs)
def accuracy_metric(actual, predicted):
    mean = 0
    for i in range(len(actual)):
        mean += (1 - abs(predicted[i] - actual[i])) * 100
    return mean/float(len(actual))
def unnormalise(val,minmax,i):
    un_val = val * (minmax[i][1] - minmax[i][0]) + minmax[i][0]
    return un_val
def load(area_no, month_no):
    data = []
    with open(r"rainfall in india 1901-2015.csv", 'r',encoding = 'utf-8-sig') as file:
        csv_reader = reader(file)
        for row in csv_reader:
            if not row:
                continue
            data.append(row)
    dat = []
    start = (115 * int(area_no)) + 99
    to = start + 6
    for n in range(start, to, 1):
        dat.append([])
        for i in range(11):
            dat[n-start].append(float(data[n+i][month_no]))
    return dat
def next_data(dataset, prediction):
    dat = []
    for i in range(1,11,1):
        dat.append(dataset[i])
    dat.append(prediction)
    return dat
def unnorm(dat,minmax):
    val = []
    for i in range(len(minmax)):
        val.append(dat * (minmax[i][1] - minmax[i][0]) + minmax[i][0])
    return val
def find_un_norm_lims(mno,ano):
    datas = load(ano,mno)
    data = datas
    minmax = dataset_minmax(datas)
    normalize_dataset(datas, minmax)
    network = nets[ano][mno]
    sj = 0
    for i in range(5):
        dataset = datas[i]
        res = predict(network, dataset)
        un_res = unnorm(res, minmax)
        small = un_res[0] - data[i + 1][10]
        sj = 0
        for j in range(11):
            if ((un_res[j] - data[i + 1][10]) < small):
                small = (un_res[j] - data[i + 1][10])
                sj = j
    return sj
def get_accuracy(ano,mno):
    dataset = load_data(ano,mno,11)
    minmax = dataset_minmax(dataset)
    normalize_dataset(dataset, minmax)
    actual = [row[-1] for row in dataset]
    predictions = []
    network = nets[ano][mno]
    for row in dataset:
        prediction = predict(network, row)
        predictions.append(prediction)
    return accuracy_metric(actual, predictions)
@app.route('/predict', methods = ['GET','POST'])
def predict_val():
    mno = int(request.args['month'])
    yno = int(request.args['year'])
    ano = int(request.args['a_no'])
    datasets = load(ano, mno)
    minmax = dataset_minmax(datasets)
    normalize_dataset(datasets, minmax)
    dataset = datasets[-1]
    index = find_un_norm_lims(mno, ano)
    acc = get_accuracy(ano, mno)
    for y in range(0, yno + 1, 1):
        for m in range(12):
            network = nets[ano][m]
            res = predict(network, dataset)
            if (y == yno and m == mno):
                un_res = unnormalise(res, minmax, index)
                res = "%.1f mm Accuracy: %.1f percent"  %(un_res,acc)
                return jsonify({'predicted': res, 'result': "predicted value returned"})
            dataset = next_data(dataset, res)
    return jsonify({'result': "error"})

